import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './pages/LoginPage'; // تأكد من المسار الصحيح
import ProtectedRoute from './pages/ProtectedRoute'
import AdminProfile from './pages/AdminDashboard'
function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/login" element={<LoginPage />} />


        {/* <Route element={<ProtectedRoute/>}> */}
        <Route path="/AdminDashboard" element={<AdminDashboard to="/AdminDashboard" />} />
        <Route path="/AdminProfile" element={<AdminProfile to="/AdminProfile" />} />


        AdminDashboard
        {/* </Route> */}
      </Routes>
    </div>
  );
}

export default App;
